import React, { Component } from 'react';
import './Header.css'


class Header extends React.Component {

    render() {
        return(
            <div class="header">
                <h1 class="h1-judul">Belajar Coding Itu 
                Menyenangkan</h1>
                <p class ="p-judul">Bersama Komunitas Belajar Program</p>
                <p class="p-judul">dan berbagai tutorial tentang tips pemrograman</p>
                <svg xmlns="img/about-us.svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
      <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M3.055 11H5a2 2 0 012 2v1a2 2 0 002 2 2 2 0 012 2v2.945M8 3.935V5.5A2.5 2.5 0 0010.5 8h.5a2 2 0 012 2 2 2 0 104 0 2 2 0 012-2h1.064M15 20.488V18a2 2 0 012-2h3.064M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
    </svg>            
    </div> 
        )
    }
}

export default Header;
